import styled from 'styled-components';

const INFO_STRING =
  '안녕하세요. 저는 웹개발자 윤인배 입니다. 리액트와 장고를 좋아합니다.';

function printText(infos) {
  const sentences = infos.split('.');
  console.log(sentences);
  return <div>{sentences}</div>;
}

printText(INFO_STRING);

const IndexBlock = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

const Index = () => {
  return (
    <IndexBlock>
      <h1>HEllo</h1>
    </IndexBlock>
  );
};

export default Index;
